$(document).ready(function() {
    $(window).scroll(function scroll() {
        // SCROLL MENU FIX & MOUSE DOWN FADE
        var theTop = $(window).scrollTop();
        if (theTop > 5) {
            $('.page-header').addClass('fixed-header');
            $('.mouse').addClass('mouse--hidden');

        } else {
            $('.page-header').removeClass('fixed-header');
            $('.mouse').removeClass('mouse--hidden');
        }

    });

    scroll();

    // HAMBURGER MENU ACTIVE

    $('.hamburger').on('click', function() {
        $(this).toggleClass('is-active');
        if ($(this).hasClass('is-active')) {
            $('.main-menu').addClass('menu-open');
            $('body').addClass('full-screen');
        } else {
            $('.main-menu').removeClass('menu-open');
            $('body').removeClass('full-screen');
        }
    });

    $('.main-menu__link').on('click', function() {
        $('.main-menu').removeClass('menu-open');
        $('body').removeClass('full-screen');
        $('.hamburger').toggleClass('is-active');
    })

    //POPUP


    $('#contactBtn').magnificPopup({
        type: 'inline',
        preloader: false,
        focus: '#username',
        modal: true,
        removalDelay: 300,
        mainClass: 'mfp-fade'
    });
    $(document).on('click', '.popup-modal-dismiss', function(e) {
        e.preventDefault();
        $.magnificPopup.close();
    });


    // OWL SLIDER
    $('.owl-carousel').owlCarousel({
        loop: true,
        margin: 10,
        responsiveClass: true,
        dots: true,
        responsive: {
            0: {
                items: 1
            },
            600: {
                items: 2
            },
            1000: {
                items: 3
            }
        }
    })


    $('#contactBtn').on('click', function() {
        var fixFormWrap = $('.fix-form__wrap');
        $(fixFormWrap).addClass('fix-form--open');
    });

    // PAGE2ID
    $("a[data-scroll='2id']").mPageScroll2id();

    // WOW.js SCROLL EFFECT

    new WOW().init();

});


// *** VANILA.JS only ***

window.onload = function() {
    window.addEventListener('scroll', function() {
        var topScroll = pageYOffset;

        // PARALLAX HEADLINE

        if (document.documentElement.clientWidth >= 768) {
            var parallax = topScroll;
            var parallaxHeight = document.querySelector('.first-section').clientHeight;
            var parallaxElem = document.querySelector('.first-section__wrap');
            if (topScroll <= parallaxHeight) {
                parallaxElem.style.transform = 'translateY(' + parallax / 2.333 + '%)';
            }
        }
    });

    //PRELOADER

    function preloaderOut() {

        var $preloader = document.querySelector('.loader__wrap');
        var body = document.querySelector('body');
        $preloader.classList.add('loader__hidden');
        body.classList.remove('full-screen');
        setTimeout(function() {
            $preloader.style.display = 'none';
        }, 200)
    }

    setTimeout(preloaderOut, 500)
}